metadata.__description:
Верх из натуральной замши с водоотталкивающей пропиткой; внутри модели современный утеплитель;
отделка голенища из натуральной овчины; подкладка ботинка из искусственной овчины;
легкая подошва с прочными противоскользящими вставками из материала Croslite;
герметичная конструкция швов и вставок обеспечивает защиту в любую погоду;
стильные водонепроницаемые всепогодные ботинки.
